B.PS=new A.bc("Os itens descritos no presente instrumento poder\xe3o sofrer altera\xe7\xf5es, unilateralmente e a qualquer tempo, por parte de ENGAGE TO HELP, para adequar ou modificar os servi\xe7os, bem como para atender novas exig\xeancias legais. As altera\xe7\xf5es ser\xe3o veiculadas OU pelo site ENGAGE TO HELP OU pelo aplicativo ENAGEG TO HELP e o usu\xe1rio poder\xe1 optar por aceitar o novo conte\xfado ou por cancelar o uso dos servi\xe7os, caso seja assinante de algum servi\xe7o.",null,B.x,null,null,null,null,null,null)
B.PT=new A.bc("O presente Termo estabelece obriga\xe7\xf5es contratadas de livre e espont\xe2nea vontade, por tempo indeterminado, entre a plataforma e as pessoas f\xedsicas ou jur\xeddicas, usu\xe1rias do OU site OU aplicativo. Ao utilizar a plataforma o usu\xe1rio aceita integralmente as presentes normas e compromete-se a observ\xe1-las, sob o risco de aplica\xe7\xe3o das penalidade cab\xedveis. A aceita\xe7\xe3o do presente instrumento \xe9 imprescind\xedvel para o acesso e para a utiliza\xe7\xe3o de quaisquer servi\xe7os fornecidos pela empresa. Caso n\xe3o concorde com as disposi\xe7\xf5es deste instrumento, o usu\xe1rio n\xe3odeve utiliz\xe1-los.",null,B.x,null,null,null,null,null,null)
B.PU=new A.bc("A plataforma poder\xe1 disponibilizar para o usu\xe1rio um conjunto espec\xedfico de funcionalidades e ferramentas para otimizar o uso dos servi\xe7os e produtos. Na plataforma os servi\xe7os ou produtos oferecidos est\xe3o descritos e apresentados com o maior grau de exatid\xe3o, contendo informa\xe7\xf5es sobre suas caracter\xedsticas, qualidades, quantidades, composi\xe7\xe3o, pre\xe7o, garantia, prazos de validade e origem, entre outros dados, bem como sobre os riscos que apresentam \xe0 sa\xfade e seguran\xe7a do usu\xe1rio.Antes de finalizar a compra sobre determinado produto ou servi\xe7o, o usu\xe1rio dever\xe1 se informar sobre as suas especifica\xe7\xf5es e sobre a sua destina\xe7\xe3o. A entrega de servi\xe7os ou produtos adquiridos na plataforma ser\xe1 informada no momento da finaliza\xe7\xe3o da compra.",null,B.x,null,null,null,null,null,null)
B.PV=new A.bc("8. Da troca e devolu\xe7\xe3o",null,B.x,null,null,null,null,null,null)
B.PW=new A.bc("Para a solu\xe7\xe3o de controv\xe9rsias decorrentes do presente instrumento ser\xe1 aplicado integralmente o Direito brasileiro. Os eventuais lit\xedgios dever\xe3o ser apresentados no foro da comarca em que se encontra a sede da empresa.",null,B.x,null,null,null,null,null,null)
B.PX=new A.bc("O usu\xe1rio poder\xe1 cancelar a contrata\xe7\xe3o dos servi\xe7os de acordo com os termos que forem definidos no momento de sua contrata\xe7\xe3o. Ainda, o usu\xe1rio tamb\xe9m poder\xe1 cancelar os servi\xe7os em at\xe9 7 (sete) dias ap\xf3s a contrata\xe7\xe3o, mediante contato com o suporte@engage2.help, de acordo com o C\xf3digo de Defesa do Consumidor (Lei no. 8.078/90). O servi\xe7o poder\xe1 ser cancelado por: a) parte do usu\xe1rio: nessas condi\xe7\xf5es os servi\xe7os somente cessar\xe3o quando conclu\xeddo o ciclo vigente ao tempo do cancelamento; b) viola\xe7\xe3o dos Termos de Uso: os servi\xe7os ser\xe3o cessados imediatamente.",null,B.x,null,null,null,null,null,null)
