B.PZ=new A.bc("3. Do acesso dos usu\xe1rios",null,B.x,null,null,null,null,null,null)
B.Q0=new A.bc("A pol\xedtica de troca e devolu\xe7\xf5es da plataforma \xe9 regida conforme o C\xf3digo de Defesa do Consumidor (Lei n\xba 8.078/90). A troca e/ou devolu\xe7\xe3o do produto poder\xe1 ocorrer por: a) direito de arrependimento;b) v\xedcio do produto.Em caso de arrependimento, o usu\xe1rio poder\xe1 devolver o produto em at\xe9 7 (sete) dias ap\xf3s o seu recebimento, mediante contato com o email cancel@engage2.help, de acordo com o C\xf3digo de Defesa do Consumidor (Lei n\xba 8.078/90). Em caso de v\xedcio do produto, dever\xe1 ser verificado v\xedcios de qualidade ou quantidade que tornem o produto impr\xf3prios ou inadequados ao consumo a que se destinam ou que lhes diminuam o valor. Ainda, poder\xe3o ser trocados ou devolvidos os produtos ou servi\xe7os que apresentam disparidade com as indica\xe7\xf5es constantes na plataforma no momento da compra ou na embalagem, respeitando as varia\xe7\xf5es decorrentes de sua natureza.O usu\xe1rio dever\xe1 entrar em contato com o cancel@engage2.help t\xe3o logo constate o v\xedcio. Se, no prazo m\xe1ximo de 30 (trinta) dias, n\xe3o for poss\xedvel resolver o v\xedcio ou, independentemente deste prazo, a substitui\xe7\xe3o das partes viciadas puder comprometer a qualidade ou caracter\xedsticas do produto ou servi\xe7o, diminuir-lhe o valor ou se tratar de produto ou servi\xe7o essencial, o usu\xe1rio poder\xe1 optar pela substitui\xe7\xe3o do produto por outro da mesma esp\xe9cie ou pela reexecu\xe7\xe3o do servi\xe7o, pela devolu\xe7\xe3o das quantias pagas ou pelo abatimento proporcional do pre\xe7o.",null,B.x,null,null,null,null,null,null)
B.Q1=new A.bc("A plataforma se reserva no direito de reajustar unilateralmente, a qualquer tempo, os valores dos servi\xe7os ou produtos sem consulta ou anu\xeancia pr\xe9via do usu\xe1rio. Os valores aplicados s\xe3o aqueles que est\xe3o em vigor no momento do pedido. Os pre\xe7os s\xe3o indicados em reais e n\xe3o incluem as taxas de entrega, as quais s\xe3o especificadas \xe0 parte e s\xe3o informadas ao usu\xe1rio antes da finaliza\xe7\xe3o do pedido. Na contrata\xe7\xe3o de determinado servi\xe7o ou produto, a plataforma poder\xe1 solicitar as informa\xe7\xf5es financeiras do usu\xe1rio, como CPF, endere\xe7o de cobran\xe7a e dados de cart\xf5es. Ao inserir referidos dados o usu\xe1rio concorda que sejam cobrados, de acordo com a forma de pagamento que venha a ser escolhida, os pre\xe7os ent\xe3o vigentes e informados quando da contrata\xe7\xe3o. Referidos dados financeiros poder\xe3o ser armazenados para facilitar acessos e contrata\xe7\xf5es futuras.",null,B.x,null,null,null,null,null,null)
